import React from 'react';
import { Route, BrowserRouter, Switch } from 'react-router-dom';
import AppNavbar from './components/Navbar';
import Home from './components/Home';
import Movie from './components/movie'; // Import the 'Movie' component
import AddReview from './components/AddReview'; // Import the 'AddReview' component

function App() {
  return (
    <BrowserRouter>
      <div>
        <AppNavbar />
        <div className="container">
          <Switch>
            <Route exact path="/" component={Home} />
            <Route exact path="/movies/:id" component={Movie} /> {/* Use :id to capture the movie ID */}
            <Route exact path="/add-review" component={AddReview} />
          </Switch>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
